import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { NextUIProvider } from "@nextui-org/react";
import { darkTheme } from "@nextui-org/react";

function CreadorEncuesta() {
  const variants = ["flat", "bordered", "underlined", "faded"];

  return (
    <NextUIProvider theme={darkTheme}>
      <div className="w-full flex flex-col gap-4">
        {variants.map((variant) => (
          <div key={variant} className="flex w-full flex-wrap md:flex-nowrap mb-6 md:mb-0 gap-4">
            <Input type="email" variant={variant} label="Email" />
            <Input type="email" variant={variant} label="Email" placeholder="Enter your email" />
          </div>
        ))}
      </div>
      <NotaFormulario />
    </NextUIProvider>
  );
}

ReactDOM.render(<CreadorEncuesta />, document.getElementById("root"));

export default CreadorEncuesta;
